(927, 'Ai nou fir raun kom sheidgeda-de, kos ai sou don hod skaifaya in', 'I have loved the stars too fondly to be fearful of the night.', 'I no fear around come shadegather-the cause I so done hold skyfire in', '1SG NEG fear SAT come night-EMPH because 1SG EMPH PAST love star SAT', 'other'),
(928, 'Ai don hod skaifaya in krei bitam na fir sheidgeda in.', 'I have loved the stars too fondly to be fearful of the night.', 'I done hold skyfire in crazy ? gonna fear shadegather in', '1SG PAST love star SAT too enough FUT fear night SAT', 'other'),
(929, 'Yu strech yu au en throu daun kom wor.', 'You walk and fight wars.', 'you stretch you out and throw down come war', '2SG walk 2SG SAT and fight SAT to war', 'other'),
(930, 'Em don ge drop of.', 'It is lost.', 'them done get drop off', '3SG PAST PASS lose SAT', 'other'),
(931, 'Ai don ste kamp raun hir, don kik raun, don hod raun.', 'I was here, I lived, I loved.', '', '', 'other'),
(932, 'Oso kik thru ogeda.', 'We survive together', '', '', 'other'),
(933, 'Yu gada uf, jova, en hodnes in.', 'You have strength, courage, and love.', '', '', 'other'),
(934, 'Yu bro laik bos haka, you!', 'Your brother is a great artist, yo!', '', '', 'other'),
(935, 'Em ste daun kom nau.', 'He\'s already dead.', 'them stay down come now', '3SG be dead by now', 'other'),
(936, 'Ai nou don sad krunes in; krunes don sad ai in.', 'I didn\'t choose the \'Kru life; the \'Kru life chose me.', 'I no done said crew-ness in crew-ness done said I in', '1SG NEG PAST choose Kru-life SAT Kru-life PAST choose 1SG SAT', 'other'),
(937, 'Taim na rid yu op, you!', 'Time to read, yo!', 'time gonna read you up yo', 'time FUT read 2SG SAT EMPH', 'other'),
(938, 'Hani gou ona yu?', 'How many lives do you have?', 'how-many go on you', 'how-many life in 2SG', 'other'),
(939, 'Chich ai op gon Trigedasleng.', 'Talk Trigedasleng to me.', 'chit-chat I up gone Tree-gather-slang', 'talk-to 1SG SAT by Trigedasleng', 'other'),
(940, 'Ai na ste kamp raun yu otaim.', 'I will always be with you.', 'I gonna stay camp around you all-time', '1SG FUT be be.LOC SAT 2SG always', 'other'),
(941, 'Ai laik Klasheda. Non na sak ai au.', 'I am the valedictorian. None outsmart me.', 'I like class-header none gonna psych I out', '1SG be valedictorian none FUT outsmart 1SG SAT', 'other'),
(942, 'Ai nou fir raun. Ai don kom au gon dison.', 'I am not afraid. I was born for this.', 'I no fear around I done come out gone this-one', '1SG NEG fear SAT 1SG PAST become SAT for this', 'other'),
(943, 'Hodnes (ste) mou yuj kom wamplei.', 'Love (is) stronger than death.', 'holdness (stay) more huge come wind-play', 'love (be) more strong than death', 'other'),
(944, 'Chit ste daun nou na wan op nowe.', 'What is dead may never die.', '? stay down no gonna wind up no-way', 'what be dead NEG FUT die SAT never', 'other'),
(945, 'Ai laik Heda kom Twel Kru.', 'I\'m the Commander of the Twelve Clans.', 'I like header come twelve crew', '1SG be commander from twelve people', 'other'),
(946, 'Oso laik sontaim kom eno.', 'We\'re all stories in the end.', 'us-all like sun-time come end-all', '1PL.EXCL be story come end', 'other'),
(947, 'Trikru nou set daun, osir throu daun.', 'Grounders don\'t give up, we fight.', 'tree-crew no set down us-here throw down', 'grounders NEG give-up SAT 1PL.EXCL fight SAT', 'other'),
(948, 'Osir lukot wan raun, sis osir au, beja.', 'Our friend is dying, please help.', 'us-here look-out wind around assist us-here out beg-you', '1PL.EXCL friend die SAT help 1PL.EXCL SAT please', 'other'),
(949, 'Hofli ai biga sis na reshwe.', 'May my big sister rest in peace.', 'hopefully I bigger sister gonna rest-away', 'hopefully 1SG big sister FUT rest-in-peace', 'other'),
(950, 'Hofli yu na hon bida chilnes op ona yu brana sonraun. Yu na ge mema we.', 'May you find peace in your new life. You will be missed.', 'hopefully you gonna hunt bit-of chill-ness up on you brand-new sun-around you gonna get remember away', 'hopefully 2SG FUT find some peace SAT in 2SG new life 2SG FUT PASS miss SAT', 'other'),
(951, 'Ai laik Omiheda.', 'I am commander of the chickens.', 'I like ?-header', '1SG be chicken-commander', 'other'),
(952, 'Ai kyon choj op.', 'I keep eating.', 'I keep-on charge up', '1SG DUR eat SAT', 'other'),
(953, 'Ai don kyon choj op.', 'I kept eating.', 'I done keep-on charge up', '1SG PAST DUR eat SAT', 'other'),
(954, 'En\'s mou beda taim ai don komba raun.', 'I should have come.', 'them-stay more better time I done come-back around', '3SG-PROG more better if 1SG PAST come SAT', 'other'),
(955, 'Gyon op, Heda!', 'Long live the Commander!', 'go-on up header', 'rise SAT Commander', 'other'),
(956, 'Ste kiken, Heda!', 'Long live the Commander!', 'stay kicking header', 'be living Commander', 'other'),
(957, 'Trikru kamp raun ai tombom.', 'Trikru is in my heart.', 'tree-crew camp around I heart', 'Trikru be.LOC SAT 1SG heart', 'other'),
(958, 'Trikru kik raun ona ai tombom.', 'Trikru lives in my heart.', 'tree-crew kick around on I heart', 'Trikru live SAT in 1SG heart', 'other'),
(959, 'Du ste krei foto, you.', 'S/he/it is really bad.', 'dude stay crazy ? yo', '3SG be very bad EMPH', 'other'),
(960, 'Du don jak ai tronkova op!', 'Someone stole my blanket!', 'dude done jack I trunk-cover up', '3SG PAST steal 1SG blanket SAT', 'other'),
(961, 'Ai don sin in du kamp raun klinrona.', 'I saw someone near the river.', 'I done seen in dude camp around clean-runner', '1SG PAST see SAT 3SG be.LOC SAT river', 'other'),
(962, 'Kom skai gon graun nodotaim.', 'From the sky to the ground again.', 'come sky gone ground another-time', 'from sky to ground again', 'other'),
(963, 'Klok nou laik, en nou na bilaik nowe, Wanheda, kom taim ai ste kiken.', 'Clark isn\'t, and never will be, the Commander of Death, as long as I\'m alive.', 'Clarke no like and no gonna be-like no-way wind-header come time I stay kicking', 'Clarke NEG be and NEG FUT be NEG Commander-of-Death from time 1SG be alive', 'other'),
(964, 'Ha yu na drag ai Snachheda klin dawe, you?', 'Whyever are you disrespecting my Raccoon-commander?', 'how you gonna drag I snatch-header clean that-way yo', 'why 2SG FUT disrespect 1SG Raccoon-commander SAT that-way EMPH', 'other'),
(965, 'Leksa laik oso yontsleya.', 'Lexa is our hero.', 'Lexa like us-all ?-slayer', 'Lexa be 1PL.INCL hero', 'other'),
(966, 'Meika\'s slak.', 'Nice to meet you.', 'maker-stay slack', 'hand-be open', 'other'),
(967, 'Yumi ste klir. Yumi\'s klir. Oso ste klir.', 'We\'re safe (from each other.)', 'you-me stay clear you-me stay clear us-all stay clear', '1DU be safe 1DU be safe 1PL.INCL be safe', 'other'),
(968, 'En\'s gon Heda. En\'s kom Heda.', 'It\'s for the Commander. It belongs to the Commander', 'them-stay gone header them-stay come header', '3SG-be for Commander 3SG-be from Commander', 'other'),
(969, 'Reshop, snogon. Ai hod yu in. Hofli yu na rid yu op os, you.', 'Goodnight, love. I love you. I hope you sleep well.', 'rest-up snog-one I hold you in hopefully you gonna ? you up awesome yo', 'goodnight loved-one 1SG love 2SG SAT may 2SG FUT sleep 2SG SAT well EMPH', 'other'),
(970, 'Kom folau, ai na gyon op.', 'From the ashes, I will rise.', 'come fallout I gonna go-on up', 'from ash 1SG FUT rise SAT', 'other');
